import React from "react";

const Table = props => {
  let tableBody;
  if (props.weather)
    tableBody = (
      <tbody>
        <tr>
          <td>Fish</td>
          <td>Fish</td>
        </tr>
      </tbody>
    );
  return (
    <table>
      <thead>
        <tr>
          <th>Condition</th>
          <th>Day</th>
          <th>Location</th>
          <th>Humidity</th>
        </tr>
      </thead>
      {tableBody}
    </table>
  );
};

export default Table;
